// StoryBar.js
import React from 'react';
import { Avatar, Box } from '@mui/material';

import boy from './assets/Avatars/boy.png';
import man from './assets/Avatars/man.png';
import nurse from './assets/Avatars/nurse.png';
import assistant from './assets/Avatars/shop-assistant.png';
import singer from './assets/Avatars/singer.png';
import steward from './assets/Avatars/steward.png';

const stories = [
  { imageUrl: boy, unread: true },
  { imageUrl: man, unread: false },
  { imageUrl: nurse, unread: false },
  { imageUrl: assistant, unread: true },
  { imageUrl: singer, unread: false },
  { imageUrl: steward, unread: false },
  // Add more story objects as needed
];

const StoryBar = () => {
  return (
    <Box sx={{ display: 'flex', overflowX: 'auto', p: 1, bgcolor: '#fff', borderBottom: '1px solid #ddd' }}>
      {stories.map((story, index) => (
        <Avatar
          key={index}
          sx={{ width: 60, height: 60, marginRight: 1, cursor: 'pointer', bgcolor: story.unread ? '#ff9800' : '' }}
          alt={`Story ${index + 1}`}
          src={story.imageUrl}
        />
      ))}
    </Box>
  );
};

export default StoryBar;
